import { Navbar } from "../Navbar/Navbar";
import "./sidebar.scss";
import navi from "../../assets/navi.png";
export const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="img-name">
        <img className="sidebar--img" src={navi} alt="phtoo" />
        <text className="img-name--item">Navdeep Singh</text>
        <text className="img-name--subtitle">Engineer</text>
      </div>
      <Navbar />
    </div>
  );
};
